import React from 'react';
import './about.css';

const About = () => {


	return (
		<div className="about">
			<h1>Présentation</h1>
			<p>Fan de nouvelles technologies, et aimant apprendre tous les jours, j'ai décidé de faire de ma passion mon métier. En effet le métier de développeur m'a toujours attiré, et c'est donc après plusieurs années d'expériences professionnelles que j'ai décidé de me reconvertir dans le numérique, je suis désormais en recherche de stage à partir d'aout 2020.</p>
        </div>
	);
};

export default About;
